import React from 'react';
import Blogpost from '../../../data.json';

function Post(props) {
  console.log(Blogpost);
  useEffect(() => {
    return () => {
      const blogpost = Blogpost.data;
    };
  });
  return (
    <div>
      {blogpost.map((post) => {
        <h1>{post.blogTitle}</h1>;
      })}
    </div>
  );
}

export default Post;
